1	Traditional Turkish Menemen	A classic, juicy Turkish breakfast dish made with eggs, peppers, and tomatoes. Perfect for dipping bread.	1. Finely chop the onions and green peppers. Peel the tomatoes and dice them into small cubes.\n2. Heat the sunflower oil in a pan. Add onions and peppers, sautÃ© until softened.\n3. Add the diced tomatoes. Cover the pan and cook on low heat until tomatoes release their juice.\n4. Crack the eggs into the pan. You can either mix them in or leave them whole.\n5. Season with salt and black pepper. Cook for another 2-3 minutes until eggs are set but still soft. Serve hot with fresh bread.	20	350	https://get.pxhere.com/photo/egg-dish-food-cuisine-ingredient-produce-menemen-recipe-comfort-food-brunch-meal-frittata-Queso-flameado-breakfast-side-dish-poached-egg-turkish-food-indian-cuisine-1620832.jpg	2	\N	t	2025-12-23 13:35:35.599605	approved	\N	Breakfast
2	Kids Favorite Pancakes	Super easy and fluffy pancakes. My kids love these on Sunday mornings!	Mix the flour, sugar, baking powder and salt in a bowl. In another bowl, whisk milk, egg and melted butter. Pour wet ingredients into dry ones and mix until just combined (lumps are fine!). Cook on a hot pan until bubbles form, then flip.	15	450	https://images.pexels.com/photos/17500011/pexels-photo-17500011.jpeg?_gl=1*1v636pc*_ga*NzYzODE3Njk4LjE3NjY0MjA0NjQ.*_ga_8JE65Q40S6*czE3NjY0MjA0NjMkbzEkZzAkdDE3NjY0MjA0NjMkajYwJGwwJGgw	4	19	f	2025-12-23 13:35:35.599605	approved	\N	Breakfast
3	Classic Red Lentil Soup	A warming, nutritious staple of Turkish cuisine. Smooth, savory, and perfect with a squeeze of lemon.	1. Wash the lentils thoroughly. Chop the onion, carrot, and potato roughly.\n2. Heat oil in a large pot. SautÃ© the onions until translucent.\n3. Add the carrot and potato, cook for 2 minutes. Add the washed lentils.\n4. Pour in water (approx 1.5 liters). Bring to a boil, then simmer for 30 mins until lentils are soft.\n5. Blend the soup until smooth using a hand blender. Season with salt and cumin. Serve with lemon wedges.	40	220	https://get.pxhere.com/photo/food-dish-Carrot-and-red-lentil-soup-cuisine-Potage-ingredient-soup-bisque-Velout-sauce-leek-soup-Caldo-de-pollo-produce-Vichyssoise-garnish-Gazpacho-broth-Tripe-soup-1612810.jpg	6	\N	t	2025-12-23 13:35:35.599605	approved	\N	Soup
4	Exam Week Tomato Soup	Cheap and fast tomato soup using tomato paste and flour. Tastes like home.	Roast the flour in butter until it smells nutty. Add tomato paste and mix. Slowly add water while whisking so no lumps form. Boil for 10 mins. Add dried mint at the end.	15	150	https://images.pexels.com/photos/18097893/pexels-photo-18097893.jpeg?_gl=1*f2upbu*_ga*NzYzODE3Njk4LjE3NjY0MjA0NjQ.*_ga_8JE65Q40S6*czE3NjY0MjA0NjMkbzEkZzEkdDE3NjY0MjA2ODAkajYwJGwwJGgw	2	9	f	2025-12-23 13:35:35.599605	approved	\N	Soup
5	Lemon Herb Grilled Chicken	Juicy chicken breasts marinated in lemon and herbs, served with fluffy white rice.	1. Mix olive oil, lemon juice, minced garlic, oregano, salt, and pepper in a bowl.\n2. Coat the chicken breasts with this marinade and let sit for at least 20 minutes.\n3. Heat a grill pan. Cook chicken for 6-7 minutes per side until fully cooked.\n4. Meanwhile, cook the rice with butter and water until fluffy. Serve together.	45	550	https://pd.w.org/2024/02/47065be0eeab1d380.65610688.jpg	2	\N	t	2025-12-23 13:35:35.599605	approved	\N	Main Course
6	Traditional Turkish Meatballs (Kofte)	Deliciously seasoned ground beef patties, grilled to perfection.	1. Grate the onion and squeeze out the excess water.\n2. In a large bowl, mix ground beef, onion, breadcrumbs (you can use stale bread), egg, cumin, black pepper, and salt.\n3. Knead the mixture for 5-10 minutes until sticky.\n4. Shape into patties. Fry in a little oil or grill until browned on both sides.	35	420	https://get.pxhere.com/photo/dish-meal-food-produce-breakfast-dessert-meat-cuisine-pork-chop-meatballs-vegetarian-food-minced-meat-scone-baked-goods-cutlet-meatball-fritter-snack-food-fried-food-frikadeller-potato-pancake-1039805.jpg	4	\N	t	2025-12-23 13:35:35.599605	approved	\N	Main Course
7	Garlic Yogurt Pasta	The ultimate comfort food when you have nothing in the fridge. Ready in 10 mins.	Boil the pasta. While boiling, mix yogurt with crushed garlic and a pinch of salt. Drain pasta, mix with the yogurt sauce. If you feel fancy, heat some oil with dried mint and pour over it.	15	380	https://get.pxhere.com/photo/dish-meal-food-produce-vegetable-plate-fresh-gourmet-lunch-cuisine-pasta-noodles-cooked-dinner-vegetarian-penne-spaghetti-vegetarian-food-diet-italian-flowering-plant-italian-food-rigatoni-european-food-1087276.jpg	1	9	f	2025-12-23 13:35:35.599605	approved	\N	Main Course
8	Classic Caesar Salad	Crisp lettuce, parmesan cheese, and crunchy croutons tossed in a creamy dressing.	1. Wash and dry the lettuce leaves. Tear them into bite-sized pieces.\n2. Cut the bread into cubes and toast them in a pan with a little olive oil to make croutons.\n3. In a bowl, whisk mayonnaise, grated garlic, lemon juice, and a little olive oil.\n4. Toss the lettuce with the dressing. Top with croutons and grated Parmesan cheese.	20	310	https://cyprus-mail.com/image/s1100x734/fill/webp/path/wp-content/uploads/2024/04/food-short.jpg	2	\N	t	2025-12-23 13:35:35.599605	approved	\N	Salad & Appetizer
9	Homemade Creamy Hummus	Better than store-bought. A rich, creamy chickpea dip.	1. Blend chickpeas, tahini, garlic, lemon juice, and salt in a food processor.\n2. While blending, slowly drizzle in ice-cold water until smooth and creamy.\n3. Transfer to a bowl, drizzle with olive oil and sprinkle with cumin or paprika.	10	180	https://get.pxhere.com/photo/dish-meal-food-produce-vegetable-plate-breakfast-healthy-cuisine-sunflower-seeds-flax-sesame-grains-paste-chickpeas-appetizer-served-hummus-close-east-672747.jpg	4	\N	t	2025-12-23 13:35:35.599605	approved	\N	Salad & Appetizer
10	Oven Baked Rice Pudding (SÃ¼tlaÃ§)	Creamy rice pudding with a caramelized top. A Turkish classic.	1. Wash the rice and boil it with water until soft.\n2. Add milk and sugar, bring to a boil.\n3. Dissolve cornstarch in a little water and add to the pot. Stir until thickened.\n4. Pour into oven-safe bowls. Bake at 200Â°C on the top rack until the tops are browned. Chill before serving.	50	280	https://images.pexels.com/photos/30403808/pexels-photo-30403808.jpeg?_gl=1*hzmzpa*_ga*NzYzODE3Njk4LjE3NjY0MjA0NjQ.*_ga_8JE65Q40S6*czE3NjY0MjA0NjMkbzEkZzEkdDE3NjY0MjEyNDIkajYwJGwwJGgw	4	\N	t	2025-12-23 13:35:35.599605	approved	\N	Dessert
